    "煙": "別件にて商談の際に、脱シリーズ紹介\n\n日報を各部門の各個人からフリーフォーマットにてメールで報告\n併せて、デスクネッツにも同様に保管しており非常に無駄と感じていると総務課長関様よりお話しを頂く\nワードベースのようなメールを各部署でバラバラのフォーマットで出している。メールをして、デスクネッツにも保管し、非常に手間\n\n※デスクネッツ30ライセンス、部署数14~15(工場込み)\n\n\n併せて教育訓練記録,改善提案記録、教育個人カード、資格取得一覧などの添付画像のフォーマットも紙管理しており、DB化出来ないかと相談を頂く\n\n①教育訓練記録【固定フォーマット】\n各部門管理者が、派遣社員などに対して、当日どのような内容で講習・指導をしたかを記録する内容\n記載項目は【教育・訓練の種類（該当の項目に○付け】、【責任者および作成者印】、【教育内容の概要（例：治具取り外しの目視確認について）】　【教育実施日・時間】、【場所】、【指導者】、【受講者一覧】、【結果（実施内容・所感・評価改善点）】、【受講者サイン】\n●困っていること：記録が台帳保管されており、総務部のみで保管していることですぐに探せない\n\n\n②改善提案記録【固定フォーマット】\n作業において自身が考案した改善を会社に対して提案し、報告する書面（成果において報奨金）\n記載項目は【日時】、【提案種別】、【上司コメント・打ち合わせ内容】、【今のやり方・記録】、【改善点（フリー記入）】等\n●困っていること：記録が台帳保管されており、総務部のみで保管していることですぐに探せない\n　　　　　　　　　総務保管のみとなるため、各拠点から同様の内容で改善提案が来るケースがあり、\n　　　　　　　　　突合できていないため重複しているが、そのままになっている\n\n③教育個人カード【固定フォーマット】\n各個人の経歴、資格取得記録（時系列）、教育を受けた実績を2枚の紙で管理\n記載項目は、【氏名・生年月日、入社日、社員コード、配属記録、資格取得記録】\n●困っていること：記録が台帳保管されており、総務部のみで保管していることですぐに探せない\n\n④資格取得一覧【固定フォーマット】\n各資格に対して、名前が羅列してあり保管されている一覧\n記載項目は各資格に対して名前を記入\n●やりたいこと：③教育個人カードを記入完了をしたタイミングで、資格取得一覧に対して反映・連携される　そうなると見る側も\n　　　　　　　　管理する側も非常に楽\n\n\nメールのフリーフォーマットの日次報告から改善を図りたいが、予算が無い状況となるため、都度稟議が必要\n一度デモや、画面を見て、その後判断したい（良いと判断できれば都度稟議でも対応可能な場合がある）\n日時報告については、ムダと感じているため、メスを早めには入れたいと考えている\nまた、基本的に手書き対応にもなるため、OCRで手書きの内容がどこまで認識取れるかを知りたいとのこと\n\nまたせっかくKintoneを仮に導入するのであれば、文書のDB化以外に例として出すのであればワークフローなど、\nより付加価値のある利用法も検討したいとの事\n\n頂いたフォーマットを利用してKintoneデモ等実施したくご相談とさせてください。\n\n※時期はご相談の上で決定　未定",
