    "煙": "2019年6月27日相談\n前回4月18日に基幹SYS入替「LEAD」導入プロジェクトにおける帳票作成部分について相談後5月10日に金額提出。\nお客様内にて今後のLEAD費用＋JBCC費用を経営層含め検討。\n以下の理由で再検討することになりました。\n①本プロジェクトはAS/400から違うシステムに置き換えることを目的として\n　スタートしたプロジェクトであり業務効率化を図るという経営層の意図が組みとれず\n　要件定義以降の費用を決裁しても効率化がなされないことが判明したたため\n\n②予算も1500万円のPKGを導入すれば効率化できると考えており結果開発費用が膨れてしまった\n③経営層と現場でプロジェクトの目的が共有されていなかった\n\nそこでお客様内で協議し、記載要望に対してRFIが提出されました。\n①長年、スクラッチ開発してきた現行システム（AS400/RPG）における維持・継続性（人・機器）を問題とし、改善を図りたい。\n②社会変化に応じ、柔軟な経営判断を促すための情報入手とともに、業務利用者の労的負担（人・時間）を低減し労的確保を図りたい。\n\n今回のご相談事項\n１．提案実施における担当SEさんのアサインおよび役割分担（提出期限：2019/07/19）\n\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n2020年3月にサービスインを予定し基幹SYSをAS/400から日販コンピュータ社「LEAD」での再構築プロジェクトが進行中。\n2019年4月上旬に要件定義フェーズが完了し必要な帳票類の洗い出しが完了している状況。\nお客様としては、LEADからの帳票印刷は考慮しておらず、PrintProにてDEFを作成しQanatサーバー側から帳票作成することを検討しております。\nJBCCは本お客様に対して、コクヨ社より＠TOVAS検討のお客様としてご紹介いただき昨年2018年12月にご挨拶を実施しており\n今回お客様から4月22日の週までに概算金額の提示を要望されております。\n\n■今回の相談事項\n・担当SEさんのアサイン\n・見積作成までのスケジュール作り\n",
