    "煙": "JBCCでもsalesforce扱うようになりましたと簡単に紹介したところ資生堂パーラー様よりsales force提案依頼頂きました。\n下記内容確認頂き、JBCCとして提案できるのか？をなんでも相談させて頂きたいです。\n【案件状況】\n６月ベンダ確定、発注ASAP、年内にリリースを目標とされ検討頂いております。\nHisol社が提案するDynamicsが競合で、SFDC提案はJBCCとsalesforceでの提案を資生堂パーラー赤塚様より依頼あり。\nグローバルでSFDCの契約が多数あり、深い値引きの提示が必要なため、ライセンスはsalesforceからの直販。\n要件についてはまだ未確定な部分が多く、想定をおく必要が多分にありますが、インプリ部分でsalesforceとの協業にてお見積り依頼あり。\n\n■プロジェクトの目的\n・資生堂パーラー様では現状CRMの整備がほとんどなく、コンタクトセンター、営業、レストランスタッフ等が\n顧客と接する際、他の接点での情報も活用して最適な顧客サービスを提供するための基盤をつくりたい\n顧客資料（関係者外秘のお取扱いでお願いします）：https://org62.my.salesforce.com/sfc/p/000000000062/a/0M000000BEy4/Relo2h32dowCYoLNCOBV9Gd16ccbUP60YB.at_tCIeg\n\n■スコープ（Step１）\n・コンタクトセンターでお客様応対アプリと営業支援システム（名刺管理含む）の構築\n・同時並行でレストランの予約管理システムを検討中（我々の提案のスコープ外、将来同アプリとSFDCの連携可能性あり。テーブルチェックになる予想）\n・同時並行で注文管理システムのリプレースを検討中（我々の提案のスコープ外、将来同アプリとSFDCの連携可能性あり）\n\n■詳細\n・コンタクトセンター25席、品質保証５名、営業２５名の利用するCRM\n・最終のコンセプト＝各顧客接点の情報を各接点でつかって最適なおもてなしを。。は変わらないがStepアプローチとする\n・コンタクトセンター（北千住、亀有、沖縄）でつかう問い合わせ管理（問い合わせ、クレーム、注文）\n　ー北千住（電話、Fax）問い合わせやクレーム\n　ー亀有（電話なし）ネット注文関係。ただ電話機能なく北千住にエスカレするなどよくある\n　ー沖縄　顧客向けアプリClubShiseidoPalorの問い合わせ　使い方とか。あんまりコールない\n　→全て、企業、人（BtoCの顧客もあり）、問い合わせ管理ができれば良い\n＊既存ECシステム(スクラッチ）とAPI連携（予定）して会員情報と注文内容をほぼリアルタイムでService側で見える必要あり\nー注文してすぐ熨斗をわすれた等の電話をしてくる人がいるため\n＊CSV手動連携はNG。バッチはOK。セキュリティポリシー上。\nいまはエクセル、メール、紙で情報管理\n・クレーム系は品質保証５名にエスカレする場合がある（問い合わせ）\n・営業系は今何も管理してないので意識改革から必要だが、赤塚様としては同タイミングで導入されたい\n　SanSanといった名刺管理で餌をぶらさげる必要ありとお考え。SFDCからはSmartviscaで提案\n　企業、人、案件、活動管理＋ダッシュボードとChatterくらい　＋名刺管理（Smartvisca）\n・注文管理システムはべつ。連携はゆくゆく。（販物基幹システム、２?３年後に入れ替える。MSになりそうとのこと）\n・コンタクトセンターは今年度中（12月中）にリリースしたい\n・ Outlook連携ニーズがあるよう。Optionで提案する必要あり\n・既存認証基盤がAzure認証基盤をつかってるのでそれと連携してSSOしたい\n\n■ご依頼の見積もり（概算）\n①営業部分\n・ライセンスはService Cloud EE＋Premierで提案予定\n・取引先、取引先責任者、商談、活動管理オブジェクトの利用を想定し、各オブジェクトを要件定義の顧客要望に合わせ設定\n・ダッシュボードをいくつか作成、提供するカスタマイズ費用も必要\n・Chatterは利用するしないが未定\n・Outlookからメールやカレンダー情報連携をする可能性があり、Optionにて費用提示\n・既存Azure認証基盤とSSO\n\n②コンタクトセンター部分\n・ライセンスはService Cloud EE+Premierで提案予定\n・取引先、取引先責任者（従業員と、BtoC顧客）、お問い合わせ（ケース）の利用を想定し、各オブジェクトを要件定義の顧客要望に合わせ設定\n・ケースに関しては、条件により品質保証部門にエスカレーションする動線が必要\n・スクラッチのECシステムから、注文者情報、発注情報をほぼリアルタイムにSFDCへ連携する必要があり、そのAPI開発費用の見積もりは必要\n（ファイル渡しも可能性としてはあり）\n・ダッシュボードをいくつか作成、提供するカスタマイズ費用も必要\n・Chatterは利用するしないが未定\n・ナレッジの利用は未定\n・既存Azure認証基盤とSSO\n\n【お客様の思いと現行の進捗状況】\nもともとインプリをどこにお願いするか資生堂パーラー赤塚様と案件を進めていく中でセールスフォースから何社か紹介し、\n価格面でリーズナブルな見込みのユーエスイー社に見積もり提示を現在依頼しているそうです。\nとはいえ、ユーエスイー社は資生堂・資生堂パーラーともに過去お取り引きはなく、資生堂パーラー様のご要件が不確定な面が多いため\n業務面をよくわかっているだろうJBCCならであればスムーズにプロジェクトが進むのではとのことから、\nセールスフォースは資生堂パーラー赤塚様からJBCCからもお見積もりをお願いされている状況だそうです。\nそのために価格だけでなく検討したいとのことが資生堂パーラー様の要望とのことです。\nユーエスイー社様の価格もまだわからないのですが、一千万程度ではないかとセールスフォースは予想しているとのことです。",
