    "煙": "Zone：NN\n\n◆アジャイル開発事例セミナー　フォロー\n　セミナー参加のお礼と、検討状況の確認を行った。\n　以下、情報システム　ほうじょう様からヒアリング。\n\n　≪背景≫\n　　現行基幹システムを刷新すべくプロジェクトが立ち上がった。\n　　現行ＰＫＧを捨てて、新ＰＫＧ＋新規開発で再構築する。\n　\n　　現行基幹システムは、販売管理（オービック７＋カスタマイズ）、\n　　経理（ミクロ情報サービス）で構築されている。\n　　オービックの現バージョンは2022年にサポート切れだが、今回バージョンUPはせず\n　　新システムを導入する。（経理はそのまま）\n\n　　自社の基幹業務のうち汎用的なＰＫＧで対応可能の部分（物販業務）は\n　　新しいＰＫＧで行い、独自性が強い業務（リース業）に関しては新規開発して\n　　ＰＫＧとデータ連携する構想で進める。\n　　新規開発部分は、既に依頼するベンダーも確定しており開発プロジェクトが\n　　始まった所。\n　　この部分はＣ／Ｏ後も自社でメンテするつもりはなくベンダーに委託する。\n　　新しいＰＫＧは現時点では未定で、製品及びベンダーを選定中。\n　　（当初MJSの販売管理を検討したが役不足で却下。\n　　　スマイル、奉行シリーズは他ベンダーから紹介を受けた。）　\n\n　≪予算≫\n　　4か年計画で予算取得済み。\n\n　≪スケジュール感≫\n　　新基幹システムのＣ／Ｏのデッドエンドは、2022年の現行PKGサポート切れだが\n　　そこまで引きずるつもりはない。\n　　できるだけ速くプロジェクトを進めて余裕をもって切り替えたい。\n　　なので新ＰＫＧの製品及び業者は2019年1月には確定したい。\n\n　≪ＪＢＣＣへの期待≫\n　　アジャイルセミナーは大変有意義で、参考になった。\n　　これから内作体制の強化をしたいと考えているし、運用保守フェーズの効率化も\n　　図っていきたい。\n　　現在、情報システムは7名（内、3名程度はOpen系言語の開発スキルあり）　　\n\n　　１．GeneXusで作成されている販売管理ＰＫＧがあれば麗しい\n　　　　→ＰＫＧ導入のスピード感と、カスタマイズや運用保守がGeneXusでできれば\n　　　　　理想的な新基幹システムと言える。\n\n　　２．ＰＫＧ化されていないなら、Geneのテンプレートの様なものでも良い。\n　　　　→販売管理業務の基本的な機能がテンプレートの様になっており\n　　　　　それをベースに最初はＪＢＣＣに開発してもらい\n　　　　　後に自分たちが運用保守できるならよい。\n　　　　　最初からゼロから開発するのでは、いくらGeneXusを使うとしても投資対効果が\n　　　　　悪いと思われるので。（汎用的な販売管理業務では、なおさらに）\n\n　　３．Gene作成のPKGがない、テンプレートもないのであれば\n　　　　ＪＢＣＣが推奨するＰＫＧとGeneXusを活用した提案をしてほしい。\n\n　　４．新基幹システムは、データセンター設置のServerに導入するのが前提条件。\n　　　（現行システムもデータセンターに置いている）\n\n　　５．処理のレスポンスはユーザーの不満が出ない様に、速い仕組みが必要。",
