    "煙": "9月決算　売上高26億　利益2~3千万　TDB添付\n\n＜2019年5月訪問＞\n2019年9月保守終了モデルだがベルのレンタルが11月まで\n2019年9月移行金額が上がったり、サポートレベルが落ちるということもないとのこと\n8月までに稟議をあげるため、6月・7月まとめる\nまた、ハードウェアリプレースだけでなく\n社内で次期システムを2025年稼働予定で\nどうしていくかの方向性を立てる\n\n2019年10月~　POWER入替　＋　準備\n2020年10月~　開発\n\n次期システムに置き換える理由の課題は二つ\n①EPACKで足らない部分を手組で作っていること\n②保守体制　EPACKの開発者は役員の高橋様のみ\n　EPACK　…高橋様　＋　OPEN系の手組（C#など）…三谷様\n\nEPACK導入時の費用は5000万くらい\n当時より業績は下降傾向\n上記の理由や業績を見ても予算は取るのは難しいと推測する\n小さく初めて投資を分散していく方向でお客様と話を進めていく\n\n対象は\nケミカル（ワックス製品）＋機械（清掃用機械）のふたつを同じシステムで管理している\n生産管理について出入はEPACKで管理しているが\n所要量計算→スケジュール→発注リストを出してEPACKの原料発注に繋げるところは手組\n手組で作っている部分も比重が高そう\n\nまずは三谷様でどの業務から切り出して進めていくかをまとめる（6月中旬）\n三谷様だけでは手一杯になるであろう部分を寄り添いながらフォローしていく\n\n---\nＥＯＳのお客様\n既存：ベルレンタル　19年9月保守切れだが延長し、20年9月までに入替\n10月決算のため2019年11月以降の予算取りを2019年8月にまとめる。\n\n予算化の際、POWERリプレースに合わせて基幹システム（EPACK）と周辺システム（お客様手組）を整理したい。\n既存ベルは担当者変更等でフォロー手薄になっているので、JBCC提案してほしいとのこと。\nアセス紹介するが、アセスでわかるのは基幹の部分だけなので、それ以外の部分を見てほしいとのこと。\n基幹システム（EPACK）よりも周辺システム（お客様手組）の保守継続性の不安が大きいため。\n\n周辺システム（お客様手組）は具体的には\n売上集計・顧客管理　ＥＸＣＥＬとC#で作成\nAS/400からODBCでデータベースのファイルから読込・書込している。\n",
