    "お客様名": "株式会社バイタルケーエスケー・ホールディングス",
    "ホームページ（URL）": "https://www.vitalksk.co.jp/company/profile.html",
    "煙": "内容 バイタルケーエスケー　ICT戦略部　部長　渡辺敬司　（ケーエスケー　執行役員　情報システム担当　兼任）　面談\n\n＜株式会社　バイタルケーエスケーホールディングス＞\nhttps://www.vitalksk.co.jp/company/profile.html\n＜株式会社ケーエスケー＞\nhttps://www.web-ksk.co.jp/about/about.html\n\n前回　清水次長へ　ＪＢＣＣの取組ご紹介　\n今回は高速開発・勤怠管理＋シフト組み・AI+RPA等の説明にて訪問\n渡辺部長より　ICT戦略部はＨＤのIT戦略を担当しており　情報システム室の機能と営業向けシステム開発を　担当\n２００９年　バイタルネット（仙台）　ケーエスケー（大阪）　統合により　システムも統合していった。\nhttps://ja.wikipedia.org/wiki/%E3%83%90%E3%82%A4%E3%82%BF%E3%83%AB%E3%82%B1%E3%83%BC%E3%82%A8%E3%82%B9%E3%82%B1%E3%83%BC%E3%83%BB%E3%83%9B%E3%83%BC%E3%83%AB%E3%83%87%E3%82%A3%E3%83%B3%E3%82%B0%E3%82%B9\n\nRPAについては部門レベルでの検討はあるもののICT戦略部としては積極的に取り組んでいるわけではない。\nＪＢＣＣの取組お話我々もツールどうこうよりも、前段の検討プロセスと　ドキュメント（設計仕様）を残す事を押している。\n\n最大の課題＝＞ACOSからの脱却　原則は　オープン化　（コンバージョンはやんわりと否定）\nＪＢＣＣとしては何かお持ちか？＝＝＞高速開発のお話：上流工程虎の巻からポイント説明\nXupper＋ＧeneXusでの開発手法に興味を持っていただく \n＝＞添付の戦略箱情報へ\nーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーー\n・前回コール時に　現状のドキュメント起こしをしており結構手間がかかっている（Xupperに興味持っていただいている）\nまずは14日のハンズオン・デモの結果を踏まえ進め方取り纏め関係者と共有＝＞翌週中に相談会の時間調整\n------------------------------------------------------------------------------------------------------------------------\n12月14日\n清水次長　・　田川さま　・　佐々木さま　（開発メンバー）　来社\n高岡さんより　GeneXusハンズオン　及び　XupperⅡ機能説明\n１．GeneXus概要説明\n  田川さまより質問、コスト・開発の時のＤＢ作成について　\n  高岡さんより　コストが劇的に下がる事はなく、同等（ケースにより少し減る事もあり）\n　　　　　　　但し、工期については短縮できる。併行して開発行える　等々\n　　　　　　　APPL と　TABLE　は同時に作れる\nＪＢＣＣのSEはGENE利用している？\n　　　　　　　基礎教育行っており。オープン系のSEだけでなく、従来のAS/400にてRPG/COBOLにて\n　　　　　　　開発行っていたSEも現状はGeneXusを使った開発を行えている。\nバイタルＫＳＫ様　開発環境\n　ACOS HOST　 COBOLにて開発\n　各サブシステム　ＰＫＧ及びJava・JSP･VB　による個別開発（デザインは社内・製造はアウトソース）\n　各サブシステム　と　基幹システム　間に　サブ系共通インターフェース（共有ＤＢ）を構築して　システム間のやり取りしている\n個別のお話\n・今回の検討時にも内々ではコンバージョンの話もあったが潰された（経営Ｔopからの指示）\n・社長の友人のIT会社がコンサル的な動きをしておりその方の声もあったとの事\n（社名は教えてもらえずだがホテルルートインの仕組みを構築した方）\n・開発ツールとしては楽々フレームワークを見たがGeneXus方が自由度が高く使えそう\n・昔はサブシステムも自分達で作成していたが現在はアウトソース（Webアプリも）\n・現状のシステムボリューム　５００画面　・　１０００帳票　で　今回の検討では削れて1割ほど\n・バッチ処理も多く　重たい処理もアリ\n・ソースのボリュームとしては　３００万Line（ｽﾃｯﾌﾟ）\n・トランザクション量は　１日　２０万件　＝＞月　５００万件～６００万件　\n　＝＞前回は　トランザクション　1日　20万件＊2倍　　ユーザー数　3000名　くらい。　（今後、デバイス数はさらに増加）\n・内部ロジックが解らない部分アリ＝＞ベンダーに現状調査依頼を行うと　１－１．５年かかりそう　（実施はしていない）\n・今回のプロジェクトとしては　３年を想定している\n・医薬品卸ならではの個別処理・例外処理があり上記の画面数・帳票数\n・現状システムのドキュメント　最新は無く。すべてが揃っているわけでもない\n・今回の取組は業務改善を取り入れた形で行うのではなく、Ｈost系のシステムをOpen系のﾌﾟﾗｯﾄﾌｫｰﾑにて置き換える事\n・課題　\n　　ホストの保守費用＝＞運用コスト削減\n　　新しいニーズに対する取組＝＞OPEN化の後に対応？\n　　COBOL技術者の確保の問題\n・目標としては　３月末をメドに　RFPを作成する予定\n・前回の２社（バイタルネットとケーエスケー）のシステム統合時には　開発コスト１０億以上かかった\n・BlackBox化している部分も含め現状の仕組みを可視化する為の作業は進めている　EXCEL/Word等に纏めていっている\n・現場の気持ちとしてはステップ分けして進められればと考えている。(EX：購買システム＝＞売上システム）\n・このプロジェクトにかかわっているメンバーは　渡辺部長以下　清水次長　ケーエスケー側　２名　バイタル側　２名だが\n　実情バイタル側の２名は現状のバックログ対応の為　機能していない\n・AS-IS(現状）のドキュメント整備にXupは必要ないが　TO-BE(新）のシステムドキュメント管理にXupは有効と感じている。\n今後の進め方（予定）\n案件相談\n　ＪＢＣＣ高速開発アプローチにて渡辺部長に提言を行う\n　ドキュメントの管理　Xupper\n　ＪＢＣＣアジャイル開発の手順にて　開発ツールはGeneXusを利用\n　開発は何段階かに分ける\n\nーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーー\n案件相談（第二回）\n　・第一回からの継続相談案件\n　・脱ACOS（販物／債権債務／実績管理／帳票出力(600種類,納品書含)　のＯｐｅｎ化\n　・今後の様々な課題に柔軟に対応出来る基盤作りのため、まずはＯＰＥＮ化を実現する（２０２２年本番）\n　・'19/5/30:RFP説明会 ⇒　'19/07提案　⇒　'19/09ベンダー決定　⇒　'19/10 PJ KICK-OFF\n　・ＧｅｎｅＸｕｓの評価も良く、ハンズオンもご参加、ＧＸ／ＸＵでの提案を実施したい\n　・まずは、提案チーム確立と５／３０ＲＦＰ説明会に参加\nーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーーー\n案件相談（第三回）\n　・第二回からの継続相談案件\n　・第二回目のご指摘頂いた事項のお客様に確認を実施\n　・その回答を持って第三回目をお願いします。",
