    "煙": "■打合せの目的\n\n　2014年に利用開始となったEV販売に関して、EoS対応、今後の消費税問題などの外部環境の変化\n　またお客様内部のシステム拡張、事業拡張に伴うEV販売の修正\n　アプリケーションのパフォーマンス、JBCC側の原田さんに依存した開発体制など\n　の問題が重なり、このままEoS対応として、Powerのご購入および追加改修を頂くにおいて\n　EV販売の将来を鑑みて、お客様へのアプローチ、持って行き方、将来像のご相談をしたく思います。\n\nこれまでの取引/取組状況を記載します。\n\n【提案～稼働までの経緯】\n・2011年10月より、基幹システムの再構築の対応の提案を実施（NN：西村SA/溝口さん）\n 　販売管理システムはＥＶ販売、会計システムはSS/400を提案\n 　→20120301_小林産業様ご提案_第三版.pptx\n　 →課題は①現行システムハードウェア（ホスト）保守終息への対応　②国際会計基準(IFRS) への対応\n●販売管理システムの稼働に先駆け、会計部分（SS/400）については2012年11月ごろより運用開始\n・当初提案内容は、ケルト社との協業で画面をDelphiではなくWebで構築しようとしていた。\n 　（Magent+RPGの構成、EV画面についてはマスター保守等一部画面のみ使用する前提）\n 　→Web側の改修について、見積もり時の要件以外の要望が多発、ケルト社は対応しきれないということで途中で撤退\n 　→全画面ＥＶ販売を使用する方向に転換、追加見積を提示、ご発注いただき対応実施\n・EV販売に関する費用感\n 　→当初見積もり：要件定義まで7M、外部設計以降28M\n 　→上記経緯から追加費用：14.8M\n●2014年１月よりＥＶ販売側の本番稼働開始\n●本番稼働後より下記内容で保守契約開始\n 　　①ＥＶ販売パッケージ保守\n 　　　　1,230,000円／年額\n 　　　　サービス内容：ヘルプデスクサービス、障害回復サービス、バージョンアップ情報提供\n 　　②ＬＣＣＡＰＰＬ\n 　　　　1,500,000円／年額\n 　　　　サービス内容：定期訪問、システム安定稼働支援（発生都度支援）\n\n  【稼働開始以降の対応状況】\n・2015年2月に、お客様情シ体制が大幅に変更（主担当２名が転職）\n 　上記に伴い情シがユーザーからの問い合わせに対応できなくなるため、\n 　ＪＢＣＣが準委任契約で本社立会いを行う半常駐支援作業を開始（70,000円／日）\n 　2015年3月から、2016年2月ごろまで対応実施\n\n・追加案件の対応状況\n 　他のＥＶユーザーに比べ、機能追加改修のご要望が多い\n　（１回の案件で１Ｍ～２Ｍ程度を、年２回程度の頻度で対応）\n・2017年8月からは、オーワハガネ工業を企業買収し、オーワハガネも同システムを利用開始\n 　（小林産業、コバックス、オーワハガネの３社が同じシステムを利用している状況）\n\n★問題・課題\n 【パフォーマンスに関しての問い合わせ状況】\n・ＥＶ販売の各種機能のレスポンスが遅いという現場ユーザーからあがっており、\n 　特に問題視されている状況\n・原因はトランザクションやマスターの件数の多さや、ネットワーク、メモリやＣＰＵ等\n 　複数の要素が絡んでおり、現在個々の内容についてどのように対処が可能か分析中\n\n【稼働筐体のEoS】\n・2019年9月末でEOS（お客様にはご連絡済み）\n　→本来10年利用できるという提案で購入した経緯があるので、素直に受け入れられない\n　→とは言いながら、機器試算中\n\n【消費税・軽減税率対応】\n・本来PKGのため、保守の中で対応できないのか？との声が上がり始めている\n\n\n",
