    "煙": "EcoOne強化月間テレソンでの新規アポ\nIaaSアンケート回答とJBCC会社案内をネタにお客様現状ヒアリング\n\nご担当の方の雰囲気が良く\n色々とオープンにお話いただけた\n\nまたIT推進も積極的に進めており、\n投資能力もありそうで色々と提案させていただけるように感じた。\n\n以下、収集情報\n\n============================================================\n\n・情報システム部はなく、経営管理部がシステム担当\n　社長の息子の専務がシステムの長、その下に大段様\n　２名体制のように聞こえた。\n\n・既存ベンダーはバラバラで、特にべったりのところはなさそう。\n　相談先は増やしたそうであった。\n\n・クラウドファーストの考え方あり\n　まずは社内に一つだけ残っているサーバのクラウド化検討\n\n・該当サーバは基幹「ペトロマスター」とファイルサーバに利用\n\n・GWについて\n　サイボウズOffice⇒LINE Worksへ乗換\n　チャット機能など便利だが、ワークフローがなく、\n　紙での運用に戻ってしまっているなどの課題あり\n　LINEと併用するためのツールを検討したいとのこと・システムについて\n　基幹　　⇒ペトロマスター：石油関係ERP　これを核にし、変えずに使っていきたい\n　　　　　　ゆきんこ　　　：灯油配達用のシステム　これは変えていきたい\n\n　現場CRM⇒３種類ほどあり\n　　　　　　車検整備システム、宅配向けCRM etc\n　　　　　　ナンバープレートで管理\n\n　その他、Excel業務あり\n\n・宅配用HT老朽化　ゆきんこ内にHT連携とCTIの機能あり\n　　　　　　　　　ゆきんこリプレイスとともに別のもの検討したい　　\n　　　　　　　　　HTにする必要ないと思っているとのこと\n　　　　　　　　　（スマホ+伝票印刷用ミニプリンターなど）\n\n　\n・インフラについて\n　ペトロマスター：本社サーバ　既存ベンダーにてクラウド化検討中\n　ゆきんこ　　　：クラウド？本社にはないとのこと\n　現場系CRM     ：クラウド？本社にはないとのこと\n　ファイルサーバ：本社サーバ　JBCCへのアンケートへ回答いただいた部分\n\n・プリンター\n　リコー\n\n============================================================\n現在聞けている課題のまとめとしては下記\n\n　・システムがバラバラで情報が整理されていない\n　・重複しているシステムもあり、二重に導入されているものもあり\n　・Excelが残っている\n　・宅配用HTの老朽化\n　・自社にサーバがある（災対、運用の手間などで持ちたくない）\n\nお客様にて既存のシステムの取りまとめと、\nToBeモデルを策定しようとしているが全然前に進んでいない様子\n\nJBCCでお手伝いさせていただける旨をお伝えし、\n2月中に行われる会議にて専務へご紹介いただけることに\n\n専務アポ取得可能なら中野さんにご訪問いただき、\nJBCCのSI進め方ご説明⇒提案合意をいただきたいです。\nその際にBANTがあれば取得、なければ作っていく動きをしたいです。",
