    "煙": "お客様システムご担当者（井狩様）から現在の基幹システムが64bit対応しておらず、\nWindows10化した時に動かなくなってしまうという話をいただいたのが発端。\n\n既存基幹システム：G-FORES（の大部分をカスタマイズ）　DBはSQL\n既存ベンダー　　：スマイルコミュニケーション\n※業界専用システムとの連携部分有、詳細未ヒアリング\n\nその後、別件（クラウド案件）でお客様専務（社長の息子で次期社長）とのリレーションを構築\n専務に基幹システムについてヒアリング行ったところ、\n「使い勝手が悪くて困っている。\n　JBCCはクラウド案件の際には良い対応をしていただき、\n　IT全般色々なことをやっていることが分かったので、基幹システムも提案してほしい」\nと言われた。（提案合意）\n\n相談2回目＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n\n【一回目相談後のアクション】\n2018/11月中に加藤が下記アクションをとる\n\n①前回かかった費用　⇒３～４M\n　これがおそらく限界値なので今回予算を聞く\n（同じぐらいしか出ないならPKG検討などを薦める）\n　⇒下記BANT内に記載。\n　　　　　　　　　　　　　\n②いまのDB・情報項目に不満があるかを聞く\n　（⇒DB再構築の必要性があるか）\n　⇒情報項目を増やす必要があるだろうとのこと\n\n③組織図、役員会議資料をもらう\n　（⇒もらえるなら）\n　⇒未入手\n\n【その他追加の収集情報】　\n■G-Foresと既存ベンダーの良い点\n・業界共通の発注システム「MEWS」との連携ができる。\n　「MEWS」と連携できるPKGはG-Foresだけ（とのこと）\n・最新verは64bit対応\n\n■G-Foresと既存ベンダーの悪い点\n・現在7割をカスタマイズして使っているが、PKGのため制約が多い。\n・保守が不行き届き。カスタマイズした部分が当時の担当者しか分からない。\n・大元がExcelベースのため画面サイズが固定。\n\n■MEWSについて\n・MEWSもスマイルコミュニケーションから提供されている\n・メーカーの新商品マスタなどが夜間バッチで配信されてくる\n・このシステムによって、各建材メーカーと建材流通店は一元化されている\n\n■お客様のやりたいこと\nシステム部　⇒64bit対応、データ抽出\n専務　　　　⇒管理（詳細未ヒアリング）\n\n■お客様へ伝えたこと\n　予算的にオーダーメイドは難しそうなので、\n　PKG基本を基本として、現在カスタマイズしている部分を作り直して\n　既存のシステムのしがらみから抜け出しませんか。\n\n■お客様へお願いしていること\n・現在のカスタマイズ部分が分かる材料\n・PKGだけの値段（現状不明）\n　⇒ともにスマイルコミュニケーションしか分からないとのこと\n　　12月中旬、下旬あたりにスマイルコミュニケーションと八興様が打ち合わせのため\n　　上記の結果をお客様より収集予定。　⇒スマイルの都合で年明けにリスケとのこと\n\n============================================================\n■前回相談結果(2018/12/18)\n\n次のアクションとしては\nお客様と既存ベンダーとの打ち合わせの後に(2018年12月末-2019年1月上旬ごろ予定)\n加藤が下記を確認\n\n①いまの画面と使ってる機能\n②なぜ７割カスタマイズしないといけなかったのか\n③アドオンした部分が本当に８割もあるのか\n④アドオン部分を捨てられないか、標準ではダメか\n\n⇒2019/1/30加藤にてお客様訪問\n　井狩様と既存ベンダーが1月中に電話でやり取り。\n　結論として、コストの問題があり、\n　今回はクラサバ型の仕組みをやめ、サーバ型のライセンスへと単純に乗換えることで\n　64bit対応（端末にとらわれないようにする）をメインに行うとのこと\n　※多少の機能追加、改修はしたいとのこと\n\n　既存ベンダーからは上記全てで20M程度で言われているとのこと\n\n　JBCCとしてはその後の\n　　・Win10対応\n　　・外部システムとの連携\n　　・アドオン開発\n　の部分の提案などさせていただける旨をお伝え\n\n既存が出してくる提案書と見積書の入手をお願いした\n　⇒2/26現在、未だ既存からの提示がないとのこと\n      3/14　専務アポ取得済み\n\n============================================================\n\n",
