    "煙": "お客様との検討テーマで上げていました、システム全体見直しについてお客様より下記メールを頂く。\n\n-----Forwarded message-----\nFrom:Masaaki Makihara<makihara@ippodo-tea.co.jp>\nTo:佐藤 幹生　様（JBCC）<m_satoh@jbcc.co.jp>\nCc:原田 耕平　様（JBCC）<k_harada@jbcc.co.jp>\nDate:  Fri, 15 Feb 2019 01:48:47\nSubject: （基幹システム再構築）提案要望の提示先を検討しています\n　佐藤　様\n\n 平素は格別のご高配を賜り、厚く御礼申し上げます。\nさて掲題の件につきまして、弊社では基幹システムの再構築をしようと\n検討しております。弊社だけでシステムの再構築は難しく、\n 協力していただけるベンダを探しております。\n\nシステム再構築にあたっての詳細情報の提示はベンダが決定してから、\nと考えております。\n\n 予定としては\n\n　　～2019年8月　　→　メインベンダ決定\n 　　　2019年9月～　→　システム再構築プロジェクト開始\n\n 添付の資料を参照していただき、規模感や構成をイメージいただいて\n弊社の基幹システムの再構築を一緒に考えてもらえるかどうかの\n打診です。\n\n 質問や疑問などありましたら、お申し出ください。\n\n 勝手ながら回答期限は　2019年3月15日　までとさせていただきます。\n\nよろしくお願いします。\n\n――――――――――――――――――――――\n・°*゜°。゜*°・゜:*°。 \n 　株式会社一保堂茶舗　情報システムグループ\n　　リーダ　牧原  正明 \n 　　　　 TEL　075-211-3435\n　　　　 FAX　075-211-3639\n　　　　 携帯 08042917689（会社）\n 　　　　 携帯 05035953739\n　　ﾒｰﾙｱﾄﾞﾚｽ　makihara@ippodo-tea.co.jp\n　　　　 URL  http://www.ippodo-tea.co.jp\n　　　　　　　　*　゜　　゜  °。\n 　　　　　　　  ゜゜。　　　 \n／￣＼　 ▲　　゜　　　　　   ☆ \n │田│　 ▲　　　▲▲▲ \n ┴─┴─┴――┴┴┴――――――――――――",
