    "背景": "システム再構築の目的（RFIより）\n当社の基幹システムは1900年代のNEC製オフコンでのパッケージソフト（会計及び販売管理）の\n利用に始まり、2000年にIBM製オフコンでの自社開発（開発は外部に委託）のリリースを経て\n現在に至っています。2000年から現在に至るまでも業務改革や事業環境に合わせて、\n大きな改修を数度行ってきました。\n当社の基幹システムは販売管理システムと生産管理システムを柱として、業務の改善や\nサービス提供手段を実現すべく改修やサブシステムとの連携を図ってきました。\nしかし、最近の事業環境やシステム環境の変化、それに伴う業務内容の変化に\n対応することが難しい状況になりつつあります。\n特に品質に対するお客様の要求は、ますます高くなってきており、従来からの仕組みを\n継承してきている現行のシステムでは、その要求に応えるための仕組みや仕掛けを\n構築することが困難になりつつあります。\nそのような状況を改善しつつ、将来への対応力も備えた新しい基幹システムのありかたを考え、\n当社が考える業務環境を実現することを目指して、当社の基幹システムの再構築に\n取り組みます。\n",
    "真の課題": "外部環境の変化の影響もあり業務内容と現行基幹システムが合わなくなり、限界を感じてきた。\nECサイトではクレジット決済を利用できるが、基幹システムでは使えない（Delphiのバージョン古い）etc\n\n基幹システムの影響なのか各システムとの連携が困難になってきた。",
    "経営的インパクト": "将来やろうとすることに柔軟に対応できるシステムを構築したい。\n現行システムは渡辺社長の思いが入っているが、もう数年で渡辺専務に代替わりする。渡辺専務の思いのシステムを作り上げる。",
    "現場のインパクト": "限界を感じている。\n各種データ連携を行いたい。\nSalesForceと基幹連携など。(Qanat　For SalesForceは紹介できていません）",
