    "煙": "【1回目】\n・会社として高齢化の観点で若手営業に働きやすい環境で働いてもらいたい\n・そのための部署としてデジタルソリューショングループがある\n・そのグループの思いとして若手の営業同士で話し合い、やりたいこと・改善したいこと等を出してもらいたい\n・その意見をくみ取って実現する方法を考えるのがデジタルソリューショングループ\n・Kintoneの紹介をしたので、どう実現できるかを先日セッション方式で会話\n・結果、若手営業より議事録改善の要望があったのでまずは話をしに行く\n\n・別件で若手営業から外からスマートフォンで基幹データ(在庫情報)をみたいという要望があったのでそちらの支援も頼みたいとのこと\n・Kintoneの話が別で進んでいるため担当の方はKintoneで実現しようと考えている\n\n外から基幹データを見たい理由は不明\n在庫情報を見たいといっていたがその情報のみなのか、\n見るだけでなく変更することも要望にないのかは不明\nリアルタイムで見たいのかは不明\n\n【2回目】\n営業部へヒアリング実施(2月28日)\n営業部としてやりたいことは、納期調整\n現在納期調整をメールで工場担当者、お客様へ対応しており打つ作業が無駄なので改善したい\nKintoneで受け皿を用意して、Kintoneと基幹のデータを連携させ、\nそこに各営業、工場担当者が記入していけばよいのではないか(お客様へは今まで通りメールで)\n\n工場と頻繁につながる営業は全部で15名ほど、工場担当者も同じくらい\nASへの情報更新は現在シェアードセンター(SSC)が行っており、ここを急に自動化するというのは業務をなくしてしまうため避けたい、\n⇒半年や1年後くらいに自動化するという事前アナウンスが必要\n\nもともとは社長からAI使えと言われていて1年検討するも合うモノがないと判断\nそのため業務改善へ方針を転換している\n社長への報告会が3月中旬、5月中旬で実施予定\n3月は今検討している内容を報告し、5月で具体的な方向性を決定させて報告する予定",
