    "煙": "【目的】　三島さんから原に担当営業が変わることを受けて担当者へ新規面談させていただく\n【出席】　松藤様　情報システム部　システム開発　課長\n【結果】　以下のお話を聞かせて頂く\n\n　＜以下、お客様の発言要綱＞\n　　・現在、次世代の仕組みの検討を行っている\n　　・現在のシステムは、何かにつけて、技術的な課題や各種制約や依存のあるシステムであり、\n　　　　すべてに対してスピード感を以って実行できないものとなっている\n　　・ﾍﾞﾝﾀﾞｰﾛｯｸ状態を解除したいと思っており、基本的には内製化を高めていきたいという考え（現在50％ほど）\n　　・例として、スマホアプリなども、Andoroid　と　iOS　の　2つ　あると、コスト　x　2　の見積もりがくる\n　　　　また、SDKのﾊﾞｰｼﾞｮﾝｱｯﾌﾟ毎に動作確認ということでそれ相応のコストが発生する形となっている\n　　・一定の予算化は行っている（300M？）ため、上期中には、なんらかの判断を行うべく、各種情報収集を行っている　　　　　\n　　・候補にあがっているものがあり、それらを更新するとした想定で予算を計上している\n　　　いくつかあるが、EC/モール販売のシステムなどは、複数あるDCの一つを撤去させるため候補となっている\n\n　＜JBCCより＞\n　　・超高速開発の事例（代々木ゼミナール様）のご紹介などをさせて頂いた\n　　　その上でいくつか質問も頂くこととなった\n　　　　　-新規要件は、あったのか？\n　　　　　-若いｴﾝｼﾞﾆｱは活躍できたのか？\n　　　　　-ﾌﾟﾛｼﾞｪｸﾄの方針は浸透したのか？\n\n　＜次回＞\n　　　質問のあった　GeneXusのﾗｲｾﾝｽの考え方や見積もりのｻﾝﾌﾟﾙを要望されたので、それは提示するものの\n　　　いくつか候補にあると言われたｱﾌﾟﾘｹｰｼｮﾝについて超高速開発に適したものかを一度協議しましょうということで了解をいただく\n　　　自社で候補の選定を行いますとのこと\n\n\n　＜補足＞\n　　　ほぼオンプレ環境で基幹系、情報系システムを構築しており、今後の定期的な更新サイクルなどから保守・運用費用を削減し\n　　　新規企画・開発投資への転換・開発スピードを狙いそのための方法論や構築手法等について、具体的な予算化をしている上で\n　　　今期何かしら実行しようとしている。\n\n　　　初回訪問だけであるので、上記に関する情報提供やサーベイを実行しつつ、中野さんのいうお客様の頭の中味（基本的な発想）や\n　　　経営者の想い（TOP化ｶﾊﾞﾚｯｼﾞ）を並行して実施できるようにしていく",
