    "煙": "[2回目記載]\nPower移行の実現性打診に訪問\nGW明けに相談頂いた現行AVX(EXPRESS5800)よりPowerへの松口課長自身による作業にて移行の実現性打診訪問。\n\n【当方よりの申し入れ事項】\n・以下にて松口課長自身にてのAVXよりPowerへの移行作業の実現性は難しいと判断した。ご要望頂いたPower + 支援の提案は難しいと判断。\n　-'19年末のEXPRESS5800の保守終息までに移行する時間が無い。松口課長は'20年に差し掛かってもいいというが、HW保守が切れている状況にて、リスクを排除できない。\n　-JBCCに手で移行する際の支援をして欲しいというが、JBCCはツールを使ったコンバージョンのノウハウはあるが、手でAVXに移行した際のノウハウはない。\n　-JBCCにて考える現実的な移行は以下流れ。\n　　①NECにてEXPRESSの後継がないのであれば、まずはNEC提案のWin+OpenCOBOLに移行更新する。まずはHW保守切れのリスクを排除する。\n　　②(コストを出せるのであれば) JBCCにてコンバージョンしてPowerへ移行。\n       (コストを出せないのであれば) 松口課長にて作業の上で、Powerへ移行。しかし、この場合はPower上野言語やインフラの教育や支援が必要。\n・ホストをAVX⇒Powerに変えれば良いというものではなく、端末やサブシステム、プリンタ機器も影響を受ける。特にドットプリンタ50台はPowerは以下では動かない可能性大。\n\n【確認事項(松口課長発言主旨)】\n［EXPRESS5800保守切れについて］\n・NECよりの通知は、'19年末を以ってEXPRESS5800のHW保守正式サポートは終わるとの内容であり、'20年以降はある部品についてはスポット対応してくれるという内容。'19年末に固執しなくていい。\n［自身での作業について］\n・AS400のファイル領域、実行エディタ、エグゼ等は、AVXと似ており、自分たちでの移行は出来るであろうと思っている。\n・自分と26歳のメンバーの2名にて現在もCOBOL対応しており、何とかする覚悟はもっている。\n［松口課長の考え］\n・今のところ、JBCCよりPower+SE支援を一番の選択肢として考えている。\n・NECの提案はWindows上へのOPEN COBOL移行なので、自分としては採用するつもりはない。\n\n⇒\nお客様の「出来る(であろう)。」との思いが強いです。\n案件としては難しいですが、本当にどのような選択肢があるのかを、考えます。\n\n------------------------------------------------------------------------\n[1回目記載]\n'18年6月モダナイセミナー勧誘ユーザー\n所在地：佐世保市\n年商：93億\n事業内容：鋼管製造業\nEXPRES5800使用ユーザー(COBOL資産総数1879本、実働800本)\n担当松口課長より「NECより'19年末でAVX(EXPRESS5800)のHW保守終息の連絡が来たので、IBM Powerへの移行を検討したい」との申し出があり。\n\n【確認事項(松口課長発言主旨)】\n・NECより、'19年末を以ってEXPRESS5800の保守終息の案内が昨年末にあり。\n・色々と悩んだが、勧誘して貰ったPowerへの移行について、真剣に検討したい。\n・Powerへの移行を真剣に考える理由は以下。\n　-NECの提案はEXPRESS以降ではなく、Windows上へのOPEN COBOLで実態が全く見えない。ツール提供までで15M円の提案。\n　-松口課長はオフコン信者でEXPRESS化も嫌だった。Powerの堅牢性に魅力を感じている。\n・昨年末よりベルデータが来て、Powerへの移行をすすめてきているが、インフラのみで開発面でのスキルに不安。\n・コストの基準はEXPRESSの単純リプレースコスト8M円、5年保守12M円で、計20M円が基準となる。お金は出せて15M円。\n・承認者は坂根社長だが、社長も本庄総務部長も、松口課長に任されている為、松口課長が上申して説得すれば通る。上層部はNECとの特別な繋がりは無し。\n\n【JBCCへの依頼】\n・上記にて、コンバージョンをするコストは出せない見解。'19年夏～'20年中に松口課長とメンバー1名にてPower内で自分で800本のCOBOL開発をする為、\n　Powerインフラ + SE支援　を提案して欲しいとの依頼。\n・上述の通り、コストは出せて15M円～20M。\n\n私にて以下を回答の上で退去。\n　-'19年末で保守が切れるHWに対し、自分で作業して移行するなどRISKが大きく危険。実現性も乏しい。\n　-お金を出して頂いてコンバージョンしても'19年末には間に合わない。\n　-社内で提案をどうするか検討の上で回答する。",
