    "Tの理由": "43922中計上、スケジュールが定まっているため。",
    "背景": "<背景>\nMUFG中計上販売注力していく「銀信約定システム」の更改案件です。\n三菱UFJ信託銀行の商品を三菱UFJ銀行でも販売するための販売管理システムという位置付けです。\n現在は当商品のほとんどを三菱UFJ信託銀行で販売しており、三菱UFJ銀行では小規模に販売をおこなっています。\n管理システムも統一されておらず、三菱UFJ信託銀行ではNotesDBを使用、三菱UFJ銀行ではAccessを使用しています。\n今後は三菱UFJ銀行の全支店で当商品を販売できるようにすることが決まり、事務量も増加するため、2社間を統一した\nWebシステムへの更改を検討しています。\n\n<スケジュール感>\n・2019年4月：ベンダー（ツール）を選定\n・2019年5月：システム化企画フェーズの開始（要件定義の準備に当たるフェーズ）\n・2020年4月：システムリリース\n\n<その他情報>\n・一部ワークフローの利用有り。\n・基盤はMUFGで用意しているAWS上を想定している。\n・画面デザインはそれほどこだわらないが、営業が使いやすいシンプルな画面にしたい。\n・ベンダー（ツール）は最低3つ以上で比較検討しなければならない。まだ他社には声がけしていない。\n\n<次回アクション>\n・GeneXusの説明+デモの実施。（お客様要望により。）",
