    "背景": "<背景・経緯>\n・富士通との一件があり、公庫内部の様々なプロセスの見直しが行われている\n・その一つして随意契約の見直しがある\n・現行システムのアプリ保守や機能改善等は随意契約で実施してきた\n・以降は入札方式で調達していく方針となった\n・調達準備にあたり、ベンダーからの見積りを1社だけでなく、複数社から取得するように契約課が方針を出した\n・中小保険のシステムについて声を掛けれそうなベンダーは、NEC、JBCC、富士通の3社しかいないというのが滝田さんの見解\n・現行システムのアプリ保守については何とか随意契約で進めることが出来そうな見込み\n\n<JBCCへの相談>\n・中小保険システムでは、2019年度に制度対応等の機能改善の案件が複数（4～5件）ある\n・その案件に対して概算見積りを提示してもらうことを検討いただけないか\n・実は、すぐにでも見積りが欲しいという案件もある\n・本気で案件を取りに来てくれても構わないです\n・見積りを算出していただくための情報はもちろん開示します\n・それなりの工数を割いてもらうことになるので、なるべく工数がかからないようなパターンを作っていきたい\n\n<星と滝田さんの意見交換>\n・お客様のご事情やお気持ちは良くわかる\n・先日、パートナーネットのアプリ保守の見積り依頼があったが、そちらは丁重にお断りした\n・現在のJBCCは、農林の案件の体制を確立して取り組むことが最優先事項である\n・したがって、相見積もりのためにSI部門のリソースを提供することが困難である\n・持ち帰って会社へSI部門へ相談をしてみるが、同様の回答が予見される\n・富士通以外のベンダーへ声掛けをした結果、誰も回答せずに1社のみの見積りになった場合はどうなるのか？\n　→同じ質問を滝田さんから契約課へしている\n　→正直、公庫内部でもベストアンサーを持ち合わせていない\n　→結果として1社だけの見積りしかないなら、それで進めざるを得ない\n\n<SI部門への相談事項>\n・農林の現行システムのアプリ保守、追加開発においても同様に相見積もりが必要になる\n・お互い様という観点から、関係構築を醸成することを検討できないか？\n・しかしながら、農林メンバー（現行システム、機能改善、本体開発）が工数を割けないと思いますので\n　セリングSEのアサインは検討できないか？",
    "真の課題": "調達の公平性・公正性の観点で、調達ルールの見直しが厳しくなってきたのは理解できるが\n現場部門(SIO)からすると実態との乖離があり、何がベストアンサーなのかが確立されていないので\nなるべく公庫および各ベンダーが工数をかけずに案件を進めていくことを見出すことが必要",
    "経営的インパクト": "本命でないベンダーが概算を出そうとすると、対象システム・機能の理解度が低いために、リスクを積んだ見積りになることが想定され\n結果として、公庫の予定価格が高く設定されてしまうことが考えられる。\nこれは調達の合理性と相反する結果となるため、経営としていかがなものかと思うが、公庫が純粋な民間企業でないことから\n現時点では調達の公平性・公正性が優先されていると考えます。",
    "現場のインパクト": "今までの不文律として、現行システムを開発したベンダーが、現行アプリ保守や追加開発を随意契約で進めていくパターンが崩れ\n複数ベンダーに見積り依頼をしたり、見積金額の妥当性評価をしたりといった工数が膨らむことが想定され、リソース的、心理的にネガティブになると考えます。",
