    "煙": "※6月25日現在の状況\n\n・GMO仁義切りは完了し、お客様にもJBCC単独提案打診→合意\n・6/14高梨さんの常務コールで「OCRがキー」とのヒント\n・6/28新井さん・藤田で再度IT部門コールし課題認識整合と今後の方針打ち合わせ\n・7/4高梨さんIT部門長コール予定\n\n※5月31日APS発表後、6月7日お客様初コール結果メール↓への高梨さん、川上さん返信で次週以降アクション検討中。\n①JBCC未来ラボとの提案検討\n②6月14日高梨さん→SMTB常務コール前に訴求点インプット\n\n上記により、今後の方針が変わる可能性あり。\n実現性と、問題・課題に応じた相談事項も決めていくため、現時点では”案件認識”お願いします。\n\n＜メール内容抜粋＞\n\n高梨さん、川上さん\n\nお疲れ様です。藤田です。\n\nAPSでもお話ししたSMTBの教育資金贈与信託のシステム化の件で、本日GMOと共にお客様先コールしてきました。\n\n結論として、GMOのAgreeフレームワークおよびそれをベースとしたワンビシのサービスは使わず、\nJBCCでアプリ開発＆クラウド＆サポート提供の方針でメンバー合意しました。（GMO、新井さん、松島さん、藤田で）\nコールしてみて、お客様課題にAgreeがマッチしないことが判明しました。（使えるけどあんまり意味ない）\n\nと同時にAPS時の宿題についてですが、完遂できておりません。\n（SMTB未来フェスからの4つの事業化の残3つのヒアリング）\n\nIR情報や本件の位置づけ（対外的に年度内リリースがマスト）については確認とれましたが、\n 時間足りず打ち合わせ終わりが多少混乱し、聞くタイミングを逸しました。\n\n先方の参加者ですが、5名中4名が個人事務企画のユーザーで、1名がIT業務推進の若手調査役（瀬能さん）でした。\n経企、デジ企は登場していません。\n今日のところは、ユーザーのやりたいことを伝える場といった感じでした。\nよって、宿題は次回に持ち越しです。\n経企が決裁上にいるのは間違いないとは思います。\n\nなお、コール後3人で会話して、本件のビジネスメリットとざっくりとした提案骨子は見えたので、このあたりは別途共有します。\n次週、上記整理して改めてJBCC単独でお客様コールしたいと思っています。\n\nここからが川上さんに相談です。\n\n今回のアプリ開発ですが、現時点でスマホネイティブアプリ（iOS/Andoroid）での提供を考えています。\n身近で一般ユーザー向けスマホアプリ開発の話を聞いたことがなく、GXでもこの領域はやってないようです。\n\n上記のビジネスメリット等理由があっての選択なのですが、提案するとなると協力会社（とデザイナー）が必要になります。\nあんしん生命絡みのパートナーには聞いているところですが、その他みずほ、JFC、保険領域でもパートナーの当てがありません。\n日本ブレーンには聞いてみようかと思ってはいます。\n\nそこで、御徒町の陳大軍さんのところはどう思いますか？\n以前みずほ向けのタブレットアプリ作った事例を聞きました。\nまだつながっていますか？\n\nアイミツ目的もありますが、手当たり次第探さないと、、という気もしています。\n\n率直な感想を聞かせてください。\n\n因みに、GMO情報と違い、普通にコンペでした。\nどこが訴求点になるかも見えてきているので、獲りに行くためにご協力お願いします。",
