    "N[N]": null,
    "Nの理由": "現行システムのブラックボックス化、後継者問題。",
    "T[T]": null,
    "Tの理由": "担当者が50代で、今後引き継ぎをしていくことを見越して、2020年くらいには取り組みたいとのこと。そのための棚卸しは随時進めていきたい。",
    "背景": "①既存のWindowsサーバーOSが2003であったこと、データが増えてきたことから、回線が遅くなっていると現場から度々要望があり、\n対応が必要となっていた。\n②既存のシステムが現行業務に合っていない\n→近年、介護用具をアビリティーズが仕入先レンタルし、お客様へ貸し出す事業が増えてきている中、\nもともと買い取りの場合でのシステムしかないため、今はレンタル品の仕入れの仕組みはEXCELで管理している。\n③開発ツール（Webtribe）がほとんど発揮できていない\n→自動生成ツールの割にプログラムを作る範囲が多い、利用ユーザーが少ないため情報源が少ない\n④基幹システムが2つに分かれているため、画面をわざわざ2画面開かなくてはならない/データの連携を夜間バッチで行うことで、翌日にならないと処理ができない。\n→AS上の売掛/買掛情報を夜間バッチでオープン系に送り、受注管理システムに反映させている。\n⑤既存システム担当者の属人化\n→50代の方がほとんど\nなどの、課題がることから、システムの見直しを行い、基幹システムを統合、再開発したいとの話が上がった。\n",
