    "煙": "訪問回数：１\n\n【相談したい内容】\n食品の製造ラインにおける、例えば人の動きかたなどの効率化のベースになる　数値ができていない領域を\n見える化させるためのヒントが欲しい\n\n\n【ヒアリング事項】\n販路としてはメインにファミリーマートへの総菜販売\n北海道で担当していただるま食品のことをお話すると\n資本関係こそないものの、昔支援していた過去があるとのことで\n話に火が付いた。\n\n弁当・総菜メーカーは「おにぎり」が一番利益率がいいが、貴社も同様「おにぎり」が利益率がいいのか？\n⇒YES　\n　補足までに、おにぎりは生産工程が単純な為、製造ラインにおける労務費も少なくて済む。\n\nということはやはり弁当が利益率が悪いのか？\n⇒YES　ここが一番の課題。\n　特にファミリーマートからの発注は改廃が非常に多いため、生産の効率化を実施するにしても　\n　改商品に対してマシンをその都度チューニング　もしくは購入ができない。\n　よって人手で解決するしかない領域。\n　*だるま食品はセイコーマートが改廃を多頻度で行っていなかった為、弁当に関しては大きな課題ではなかった。\n\n　だるま食品では弁当の生産ラインは外国人を置いており、ラインでの動きの統率が取れないことが\n　課題といっていたが、同様か？\n　⇒YES\n\n　生産ラインの導線標準化などはどうか？\n　⇒面白そう。\n\n　主に生産ラインにおける労務費を下げるために今後どうしていくのか課題であるとのこと。\n　用は「たとえば。。今日この弁当はいくらでつくれたよね。。昨日はいくらだったのにどうしよう」\n　材料費、労務費は何となく見えているが、他見えていない領域をどう可視化していくのかのかが　\n　提案参画できそうな領域であった。\n\n　上記に対するヒントが欲しい\n\n\n\n【その他ヒアリング情報】\n\n日配か？\n⇒違う。　朝/昼/晩の配送スケジュール\n　これに関しては今後コンビニが24H営業でなくなる可能性もある為、今後大きく動く。\n\n日清製粉の完全子会社になると記事が出ていたが、システム統合や、経営層の変化はあったか？\n⇒ない。　これからも大きく変わることはない。\n\n上記は敵対的TOBだったか？\n⇒違う。　もともと49:51等で保有株式が推移していたため、敵対的なものではなく\n　協業の強化という目線。\n\n\nファミマ以外の販路は？\n量販店、スタバ、ドトール等\n小さい店舗（さんちゃんショップ）にも昔はやっていたが今は一切ない。\n*零細企業の統廃合の動きが盛んで相手にしててもしょうがない。\n\n\nサピエンスを利用中。GeneXus\n汎用機を10年以上使っている。\n⇒2000問題のときにほとんど機能を外だし。\n \n　今は販売系しか使っていない。\n　⇒ASに切り替え\n　　現行はサピエンスで開発している。\n \n内作がメインでやっている。\n",
