    "煙": "【相談したい内容】\nアセス実行の為の再訴求プランを相談したい\n\n\n【ヒアリング事項】\nアセスメントの完全合意を本日の目標としていたが、いまいち合意とまではいかなかった。\n上記に関してはもう一度、アセスメントで何がしたいのか、メッセージをし直し\n再度合意がである。\n\nAPS的ヒアリングについて\n高砂熱学工業との関係性がIRから読み取れなかった為、ヒアリングを実施\n\n・高砂の完全子会社であるが、システム的、経営的にみて、どのような関係性か？\n　⇒基本的にネットワークが統合されている程度で独立していると考えていい。\n　　経営方針　目指している方向等もシステム的に落ちてくることはない為、割と自由は効く\n　　ただし大型案件10M～30M程度は親会社の決裁も入る。（押し込むことはできるそうであるが）\n\n・販売チャネルに関して\n　⇒高砂への販売は全体の20%も行かない程度である。\n　　他はサブコン・ゼネコンなどの主要取引先がメイン\n　　18年の決算上78億の売上であったが、22年（創立50周年）に向けて、100億の目標を掲げている（経常利益10億）\n\n・経営方針として売上拡大、利益改善どちらがプライオリティが高いか？\n　⇒売上拡大\n　　6月からモノタロウにて、SPOTエアコンの販売を実施するなど\n　　新規の販売チャネル開拓に向けて、新商品開発・マーケット開拓に取り組み始めた。\n　　上記が投資領域でありそうという所感\n\n　　また売上拡大の為に昨年　USAピーマックを設立\n　　USA仕様の商材をPMACとして開発をし販売をし始めた。\n　　日本法人としてはUSAの販売システム等は相乗りではなく、独立して構築してほしいと考えている様子。\n　　なぜそう考えているかは今回ヒアリングできなかったが\n　　嗅覚的にそこにシステムの課題があるのではないか？と予測　\n　　アセスを絡めて、上記に関してもヒアリングを実施したい。\n\n\nインフラ以外の内容から上記のような事柄が新たにヒアリングできた。\nPMAC様の方向性に合わせて、システムのロードマップを描くために、アセスが必要であるという\n訴求ストーリーを描きたい。\n\n",
