    "煙": "訪問回数：２\n\n【相談したい内容】\nアパレス系製造ライン、業務におけるコスト削減方法のヒント\n\n\n【ヒアリング事項】\nAPS観点からのヒアリング事項は以下\n\n経営からみた重点は？\n⇒利益の追求\n\n労働集約型の生産ラインなので、そこのコスト削減が一番大きいのか？\n⇒そういうわけではない。\n　青森は日本人、中国拠点は外国人という形になっており、海外の人材のコスト増がネック。\n　（中国は一人っ子政策により生まれた子供が労働生産人口の比率が多いため、ブルーカラーの仕事は好まれない）\n\n\nATSUGI　VISION２０１７⇒２０２０の変化について\n海外戦略について記載がなくなったがあきらめたのか？\n⇒そういうわけではないが、上海におけるマーケットへの参入に苦戦中\n　⇒参集障壁はコスト？？？\n\nヨーロッパもトライしたが、サイズが異なる為、断念。\n\nATSUGI　VISION　2020では\nコスト削減が多く明記されているが、どのような取り組みをするのか？\n⇒構造改革推進室がプロジェクトオーナーとなり、いろいろとテコ入れをする。\n　⇒そこには情シスは直接絡まない。\n　　あくまで間接部門として、プロジェクトに参加するとのこと。\n　　（そもそも情シスの人数が足りていない。）\n\n構造改革推進室では具体的な取り組みが決まっているのか？\n⇒まだ決まっていない。\n\n\nヒアリングした感じ\n女性の美を意識した新たなブランディング強化と、コスト削減の2軸であることがわかったが\n具体的な取り組みについてはまだ未定な要素が多かった。\n\n次回　ブラッシュアップしたディスカッションペーパーをお持ちし\nさらに深掘りを進める。\n\n【その他】\n意識するコンペはどこか？\nグンゼ＠大阪、タビオ＠大阪",
