    "煙": "目的】\nLOBに単独訪問を実施し、課題をヒアリングするために今回の往訪を実施\n\n\n【結果】\n山之内さんは現場の営業事務経験が10年以上ある方であり\n全て現場業務をご理解されている方であった為\n具体的な課題がヒアリングできた。\n\nヒアリング事項は以下\n\nお客様はどんな業界か？\n・ゼネコン、鳶会社、プラント関係、橋梁系\n\n大まかな仕事の流れは？\n客⇒営業所⇒機材センター\n\n客からの注文の入り方から基幹入力、手配までのフローがかなりアナログ業務であり\n膨大な工数がかかっている為、どうにかしたいと思っている。\n\n具体的には以下の通り\n\n客からの注文パターンは以下の4通り\n・Web受注システム（2年前に構築したもの、全体の2~3割）\n・FAX（3.5割）様式はゼネコン用、プラント用と別れており、中にはお客様の様式の存在する。\n・電話（3.5割）\n・メール（一部）\n\n課題点はFAXと電話\n東京営業所では2000件/月以上を事務員10人で処理をしている。\nFAXを受けたのちに、受けて終わりではなく\n足場の組み合わせが誤っていないか？　他に+αで提案することはないか？など\n細かい内容を常に確認している為、かなり時間がかかっている。\n⇒逆にいえば、それが杉孝さんに強味ですよね？という問いに関してはyes\n\n加えて\n「読み合わせ」という業務が存在し\n基幹システムにFAXの内容を打ち込んだのちに、期間の入力画面を読み上げ\nもう一人がFAXとの内容に齟齬がないか、確認するフェーズが存在している。\nここでは入力の確認もそうであるが、第三者からみて、「この内容なら、これも提案したら？」と\n+αを追求しているとのこと。\n\n「営業事務はプロフェッショナルである」と自信をもってお話されていたので\n強味を残しつつ業務を効率化できる方法を模索している様子。\n\n\n足場の組み合わせは、エラーチェックができる仕組みがあればかなり効率化できそう。\n+FAXの一時入力はOCR等でデータを流しこむことができればかなりの工数削減になりそう。\n\nまだ業務ヒアリング段階の為、具体的にsolの紹介等は実施していないが\n何かヒントがあるはずである未来展には山之内さんの上長とご来場いただく予定。\n⇒これは確実にご来場いただけるよう、重点フォローしていく領域\n\n\nまた電話注文も将来的には\n統合されたコールセンターの立ち上げを考えており、そのヒントも求められていた。\n少しでも電話を受けながらの入力を簡素化しなければ人も足りなくなってきている為、危機感がある。\n具体的にはかかってきた電話番号をベースに、自動的に顧客名が入るなど...\n+3000品目を超える足場の組み合わせのエラーチェックの仕組みがあるとBetter\n\n",
