    "煙": "・営業システム（販売管理）見直しについて\n今年度予算は取得していないものの、\n営業業務の標準化に向けてコンサルを検討中\n→業務が多く複雑化しており、課題が整理できていない。\n　ユーザーから声が上がるたび個別対応しているが限界がある。\n　→販売管理のユーザーの営業事務が受注取込を実施するが、\n　　知識が属人化しており辞めてしまう　等　　\n\n今後の見通しとしては\n営業業務の課題見直し、システム要件への落とし込み、\nRFP作成という流れになっていくようですが、\n営業としては可能な限り上流の検討段階から参画できないかと考えております。\n※中嶋課長には携わり方は検討するが\n　RFP作成前から参画したい意思は伝えております。\n\n上記について6/14予定のSI拡大セッションにて相談させてください。\n\nまた以下は営業にて利用しているシステム一覧です。\n\n販売管理（今回の見直し対象になるようです）\nメール（カゴヤのメールサーバー、メーラーはユーザーにお任せ）\nファイルサーバー（一部NAS利用）\nグループウェア（Garoon）　\n　→経企で10名ほどGsuiteを利用中\n名刺管理（SanSan）\n経費精算（マネーフォワード）\n部門システム（Accessで作成）\n　→外部ハウスメーカーの注文データ（CSV？）を取り込み、\n　　販売管理と連携\nLINE（個人、社用端末で利用、コンシューマー用）\n　→外部からカタログの取得、在庫情報の照会に利用\nTV会議（GoogleMteet）\n",
